    if mibBuilder.loadTexts: adGenAOSQoSMib.setRevisionsDescriptions(('Changed description of adGenAOSQoSInterfaceTXQType. Changes by Michael Weir.', 'Added enumeration values to adGenAOSQosMapMatchType and adGenAOSQoSMapProtocolMatchType for QoS IPv6 configurations. Changes by Reba Holland.', 'Added adGenAOSQoSMapPriorityStrictRateLimiting to adGenAOSQoSMapEntriesTable. Changes by David Wallace.', 'Added configuration information to adGenAOSQoSMapEntriesTable and shaping statistics to adGenAOSQoSInterfaceTable. Added adGenAOSQoSMapMatchTable and adGenAOSQoSMapShaperTable. Changes by Reba Holland.', 'Added rate statistics to adGenAOSQoSClassConvHistoryTable and adGenAOSQoSPriorityRateLimiterTable. Added adGenAOSQoSMapClassifierStatsTable. The adGenAOSQoSMapClassifierStatsTable will initially display only default class information. Changes by Reba Holland.', 'Changed name of OIDs adGenAOSQoSMapEntryActionType, adGenAOSQoSMapBWType, adGenAOSQoSMapBWValue, to adGenAOSQoSMapQueuingActionType, adGenAOSQoSMapQueuingBWType, adGenAOSQoSMapQueuingBWValue. Changes by Reba Holland.', 'Added adGenAOSQoSInterfaceTable. Changed adGenAOSQoSClassConvHistoryTable to use ifIndex, adGenAOSMapEntryId, and adGenAOSQoSMapParentEntryId as indices. Changed adGenAOSQoSPriorityRateLimiterTable to use adGenAOSQoSPriorityRateLimiterParentId as an index. Changes by Reba Holland.', 'Added the following to the adGenAOSQoSMapEntriesTable - adGenAOSQoSMapEntrySetName, adGenAOSQoSMapEntryActionType, adGenAOSQoSMapBWType, adGenAOSQoSMapBWValue. Changed adGenAOSQos to be under the adGenAOSRouter tree instead of the adGenAOSCommon tree. Changed name, indices and OIDS of adGenQOSQoSConversationTable to adGenAOSQoSClassConversationTable. Changed name, indices and OIDS of adGenQOSQoSConvHistoryTable to adGenAOSQoSClassConvHistoryTable. Changes by Reba Holland.', 'Changed the following from Integer32 to Unsigned32 - adGenAOSQoSMapSetId, adGenAOSQoSMapEntryId adGenAOSQoSHistoryConvId, adGenAOSQoSHistorySetId, adGenAOSQoSHistoryEntryId, adGenAOSQoSConvId. Changed description of adGenAOSQoSConvHistoryTable and adGenAOSQoSConversationTable. Removed adGenAOSQoSMapSetId as an index to adGenAOSQoSPriorityRateLimiterTable and added adGenAOSQoSPriorityRateLimiterSetId as an entry. Changes by Reba Holland.', 'Added adGenAOSQoSMapChildSetName to adGenAOSQoSMapEntriesTable. Changed indices of adGenAOSQoSConvHistoryTable. Changed description and indices of adGenAOSQoSMapEntriesTable. Changed OID name of adGenAOSQoSRateLimiterTable to adGenAOSQoSPriorityRateLimiterTable. Changes by Reba Holland.', 'First Draft of ADTRAN-AOS-QOS MIB module. ********************************** QoS Overview ********************************** This MIB allows read-only access to quality of service (QoS)statistical information for QoS enabled ADTRAN products. A QoS-policy is defined using a QoS map in the ADTRAN Operating System (AOS) command line interface (CLI). The QoS map is a named list with sequenced entries. An entry contains match references and one or more actions. Multiple map entries for the same QoS map are differentiated by a sequence number. The sequence number is used to assign match order. Once created, a QoS map must be applied to an interface in order to actively process traffic. Any traffic for the interface that does not explicitly match a map entry is sent using the default queuing method for the interface (such as weighted fair queuing (WFQ). All QoS configuration must be done by the ADTRAN command line interface (CLI) or the WEB GUI.',))
